import React from "react";
import { Link } from "react-router-dom";
import { user as userAPI } from "../../utils/API";
// import "./style.css";

// Depending on the current path, this component sets the "active" class on the appropriate navigation link item

const Navbar = (props) => {
    const signout = () => {
        userAPI
        .signout()
        .then(() => props.setUser({}))
        .catch((e) => {
            throw e;
        });
    };

    console.group("navbar");
    console.info(`ðŸŒŽ page rendered at path: '${props.match.path}'`, "\n");
    console.info("ðŸ¤– user", props.user);
    console.groupEnd();

    return (
      <nav className="nav">
          {
              <div className="main-nav hide">
                  <div className="main-nav-content fixed-width">
                      <h1 className="h1">MEALBITES</h1>
                      <ul className="navbar-nav">
                      <li className="nav-item">
                        <Link
                          to="/"
                          className={
                            window.location.pathname === "/"
                              ? "nav-link active"
                              : "nav-link"
                          }
                        >
                          Home
                        </Link>
                      </li>
                      <li className="nav-item">
                          <Link
                            to="/signup"
                            className={
                              window.location.pathname === "/signup"
                                ? "nav-link active"
                                : "nav-link"
                            }
                          >
                            {props.user.id ? <span>User Profile</span> : <span>Sign Up / Log In</span>}
                          </Link>
                        </li>
                        <li className="nav-item">
                          <Link
                            to="/about"
                            className={
                              window.location.pathname === "/about"
                                ? "nav-link active"
                                : "nav-link"
                            }
                          >
                            About
                          </Link>
                        </li>
                        <li className="nav-item">
                          <Link
                            to="/inventory"
                            className={
                              window.location.pathname === "/inventory"
                                ? "nav-link active"
                                : "nav-link"
                            }
                          >
                            Watch the Action
                          </Link>
                        </li>

                        {props.user.id ? (
                          <Link
                            to="/posting"
                            className={
                              window.location.pathname === "/posting"
                                ? "nav-link active"
                                : "nav-link"
                            }
                          >
                            Posting
                          </Link>
                        ) : (
                          <></>
                        )}
                        <li className="nav-item">
                          {props.user.id ? (
                            <Link
                              onClick={signout}
                              className={
                                window.location.pathname === "/"
                                  ? "nav-link active"
                                  : "nav-link"
                              }
                            >
                              Sign Out
                            </Link>
                          ) : (
                            <></>
                          )}
                        </li>
                      </ul>
                  </div>
              </div>
          }
      </nav>
  );
};

export default Navbar;
